import React from 'react';
import './Homepage.css';

const Homepage = () => {
  return (
    <div className="homepage">
      <div className="homepage-header">
        <h1 className="homepage-title">Welcome to EVA</h1>
        <p className="homepage-subtitle">
          Your intelligent project management dashboard
        </p>
      </div>
      <div className="homepage-content">
        <p>Navigate to Planning to start managing your projects, tasks, and events.</p>
      </div>
    </div>
  );
};

export default Homepage;
